import React from "react";
import { Container, Row, Col } from "reactstrap";

const Header = () => (
  <Container>
    <Row>
      <h1 className="apptitle">
        <i class="fas fa-clipboard-list"></i> Plan ahead
      </h1>
    </Row>
  </Container>
);

export default Header;
